package StringDemos;

public class EndsWithAndMore {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String str = "we are on google meet";
		
		System.out.println(str.endsWith("eeet"));
		
		System.out.println(str.startsWith("we ar"));
		
		System.out.println(str.contains("on"));
	}

}
